import React, { useEffect } from "react";

import carData from "../../assets/data/carData";
import { Container, Row, Col } from "reactstrap";
import Helmet from "../Helmet/Helmet";
import { useParams } from "react-router-dom";
import BookingForm from "./BookingForm";
import PaymentMethod from "./PaymentMethod";

const CarDetails = ({ item }) => {



  return (
    <>
      <center><h1>Showing Car Details</h1></center>
      <div className="Container">
          <div>
          <h5>Brand Name: {item.brandName}</h5>
          <h5>Model Name: {item.modelName}</h5>
          <h5>Year: {item.year}</h5>
          <h5>Price: ${item.price}</h5>
          <h5>Mileage: {item.mileage}</h5>
          <h5>Fuel Type: {item.fuelType}</h5>
          <h5>Transmission Type: {item.transmissionType}</h5>
          <p>Description: {item.description}</p>
          </div>
      </div>
    </>

  );
};

export default CarDetails;
